import * as React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Cookies from 'universal-cookie'
import '../styles/login.css'


function Navbar() {


  //Para acceder a las cookies
  const cookies = new Cookies();

  //Para convertir la cookie en JSON
  var json = JSON.stringify(cookies.get('usuario'));

  //Verificamos que el usuario esté registrado
  if(json==null) {
      window.location.href='/login';
  } else {
  
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light" style="background-color: #e3f2fd">
        <a class="navbar-brand" href="#">
    <img src={require('../media/albalat_logo.png')} width="30" height="30" class="d-inline-block align-top" alt=""/>
  </a>
  <a class="navbar-brand" href="#">Navbar w/ text</a>
  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarText">
    <ul class="navbar-nav mr-auto">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Features</a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Pricing</a>
      </li>
    </ul>
    <span class="navbar-text">
      Navbar text with an inline element
    </span>
  </div>
</nav>
  );
    
}
}

export default Navbar;
